Y COMERCIALIZACIÓN DE UN PRODUCTO O MATERIA PRIMA. en virtud de lo anterior es procedente continuar el trámite de la personeria jurídica bajo dicha denominación, conforme a lo establecido en el Artículo 72 de la Ley de Procedimiento Administrativo y Artículo 8 del Reglamento de la Ley del Sector Social de la Economía. Dicha Constancia tendrá vigencia por un período de sesenta días a partir de la fecha.\",{\"text\":[\"\\n\\nDado en la ciudad de Tegucigalpa M.D.C, 24/07/2024.\"],\"marginTop\":15}],\"marginTop\":20,\"lineHeight\":1,\"alignment\":\"justify\"},{\"canvas\":[{\"type\":\"line\",\"x1\":0,\"y1\":0,\"x2\":280,\"y2\":0,\"lineWidth\":0.8}],\"alignment\":\"center\",\"marginTop\":130},{\"text\":\"LIC. ROSA ANGELICA FAJARDO BONILLA\\nSUBDIRECTORA DE FORMALIZACION\",\"marginTop\":15,\"alignment\":\"center\"},{\"image\":\"public/images/firma.png\",\"width\":170,\"alignment\":\"center\",\"opacity\":0.9,\"absolutePosition\":{\"x\":85,\"y\":475}},{\"stack\":[{\"qr\":\"https://devsse.senprende.hn/\",\"fit\":97,\"alignment\":\"center\",\"marginTop\":68},{\"text\":\"*Escanea el documento para verificar su validez*\",\"alignment\":\"center\",\"fontSize\":10,\"marginTop\":10}]}],\"footer\":{\"stack\":[{\"image\":\"public/images/footer_logos.jpg\",\"alignment\":\"center\",\"width\":450,\"opacity\":0.5,\"margin\":[0,0]},{\"text\":\"Boulevard Juan Pablo II, Centro Cívico Gubernamental, Torre 2, Niveles Nº 12 y Nº 21 Tegucigalpa. \\nUPEG.R.01 | Revisión 10 | julio del 2024\",\"alignment\":\"center\",\"lineHeight\":1.1,\"fontSize\":9,\"color\":\"gray\",\"bold\":true,\"marginTop\":5}]},\"defaultStyle\":{\"font\":\"Arial\"},\"pageSize\":\"LEGAL\",\"background\":[{\"image\":\"public/images/water_mark_blank_new.jpg\",\"width\":612,\"height\":1008.126}]}'),(60,1,'<!DOCTYPE html><html lang=\"es\"><head><meta charset=\"UTF-8\"><meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\"><meta name=\"viewport\" content=\"width=device-width,initial-scale=1\"><title>Constancia de notificación de renuncia.</title><style>*{font-family:Arial,Helvetica,sans-serif;box-sizing:border-box}body{box-sizing:border-box;background-size:cover;padding:0!important;margin:0!important}footer{position:fixed;bottom:0;width:8.5in;padding-bottom:5mm}@page{padding:0;margin:0}</style></head><body><img src=\"https://sse.senprende.hn/images/water_mark_blank.jpg\" style=\"position:fixed;top:0;left:0;width:100%;height:100%\"><main style=\"height:14in;width:8.5in;position:relative\"><table><thead><tr><td><div class=\"header-space\" style=\"display:flex;justify-content:space-between;padding:10mm 15mm;align-items:center\"><img src=\"https://sse.senprende.hn/images/honduras_emprende_logo.webp\" width=\"128px\" height=\"42px\"> <img src=\"https://sse.senprende.hn/images/senprende_gob_logos.jpg\" width=\"156px\" height=\"56px\"></div></td></tr></thead><tbody><tr><td><div class=\"content\" style=\"text-align:justify;margin:0 5rem\"><p>Recibido de la Secretaria General en fecha veinticinco (25) de abril del dos mil veintitres (2023) siendo las (09:58 AM) el expediente SG-PJ-P-0053-2023 constando de Noventa y Cinco (95) folios útiles.</p><p><b>SERVICIO NACIONAL DE EMPRENDIMIENTO Y DE PEQUEÑOS NEGOCIOS.– SUB DIRECCION DE FORMALIZACION.-&nbsp;</b>A los dos (2) días del mes de mayo del año dos mil veintitres (2023).</p><div style=\"text-align:center\"><p><b>&nbsp;DICTAMEN TECNICO LEGAL Nº DTL-P-0045-2023&nbsp;</b></p></div><p>Esta Sub Dirección de Formalización, en cumplimiento a lo ordenado en el acuerdo de delegación 014-2022, de fecha (ocho) 08 de junio del 2022, procede a emitir Dictamen técnico Legal en relación a la<b>&nbsp;“SE SOLICITA EL OTORGAMIENTO DE LA PERSONERIA JURIDICA, APROBACION DEL ACTA DE CONSTITUCION Y DE ESTATUTOS, INSCRIPCION EN EL REGISTRO DE EMPRESAS DEL SECTOR SOCIAL DE LA ECONOMIA; SE EMITA LA CONSTANCIA DE CUERPOS DIRECTIVOS, ASI COMO LA CONSTANCIA DE INSCRIPCION EN EL REGISTRO DE EMPRESAS DEL SECTOR SOCIAL DE LA ECONOMIA, APROBACION DEL ACTA DE CONSTITUCION Y DE ESTATUTOS Y CERTIFICACION DE LA PERSONERIA JURIDICA.- SE PRESENTAN DOCUMENTOS.- SE PRESENTA PODER.-”&nbsp;</b>, presentada por<b>&nbsp;JOSE ROQUE CRUZ LAGOS&nbsp;</b>en su condición de Apoderado Legal de la<b>&nbsp;EMPRESA DE SERVICIOS MÚLTIPLES LAS MERCEDES EL TABOR&nbsp;</b>con numero de expediente<b>&nbsp;SG-PJ-P-0053-2023&nbsp;</b>, de la manera siguiente:</p><p><b>PRIMERO:&nbsp;</b>Que mediante<b>&nbsp;Decreto Ejecutivo No. PCM 034-2019&nbsp;</b>, publicado en fecha dieciocho (18) de julio del dos mil diecinueve (2019), en el Diario Oficial La Gaceta No. 34,999, se creó el<b>&nbsp;Servicio Nacional de Emprendimiento y de Pequeños Negocios (SENPRENDE)&nbsp;</b>, como una entidad desconcentrada de la Presidencia de la República, con personalidad jurídica, independencia técnica, administrativa y financiera, con domicilio en la ciudad de Tegucigalpa M.D.C., departamento de Francisco Morazán, pudiendo establecer oficinas regionales en cualquier lugar del país y será responsable de la aplicación de la normativa de la micro, pequeña y mediana empresa, desarrollo del emprendimiento, de las empresas del Sector Social de la Economía y la innovación, así como los programas financieros de acceso al financiamiento asociados a estos sectores y que se rige por este Decreto y demás Leyes que por su naturaleza y similitud le sea aplicable.<br></p><p><b>SEGUNDO:&nbsp;</b>Que en fecha veinticinco (25) de abril del año dos mil veintitres (2023), se presentó ante la Secretaria General del Servicio Nacional de Emprendimiento y de Pequeños Negocios (SENPRENDE), la Solicitud de mérito, acompañando la documentación correspondiente. Que mediante auto de fecha veinticinco (25) de abril del año dos mil veintitres (2023), la Secretaría General de este Servicio Nacional de Emprendimiento y de Pequeños Negocios (SENPRENDE), ordenó que se remitieran las presentes diligencias a la Subdirección de Formalización a fin de efectuar el pronunciamiento conforme a lo solicitado.</p><p><b>TERCERO:&nbsp;</b>Que consta en el expediente de mérito, la documentación que se describe a continuación, misma que se analiza desde el punto de vista legal:</p><ol><li>Solicitud de fecha 20 de abril del año dos mil veintitrés (2023). (folio 01).</li><li>Carta poder de fecha 31 de marzo del año 2023. (folio 02).</li><li>Copia del carnet del colegiación del abogado JOSE ROQUE CRUZ LAGOS No 27691 (folio 03).</li><li>Informe de denominación de fecha 31 de marzo del año 2023 (folio 04).</li><li>Certificación de acta de constitución dé la EMPRESA DE SERVICIOS MULTIPLES LAS MERCEDES DEL TABOR. (folio 05 Y 06).</li><li>Listado de asistencia a asamblea constitutiva (folio 07 al 09).</li><li>Fotocopias de tarjetas de identidad de los socios (folio 10 al 42).&nbsp;</li><li>Certificación de estatutos de la EMPRESA DE SERVICIOS MULTIPLES LAS MERCEDES DEL TABOR (folio 43 al 63).</li><li>Estado de resultado de fecha 01 de enero al 31 de diciembre de la EMPRESA DE SERVICIOS MULTIPLES LAS MERCEDES DEL TABOR (folio 64 al 65).</li><li>Certificado de autenticidad No. 6097138 de fecha 15 de abril del año 2023 (folio 66).</li><li>Recibos tgr de fecha 31 de marzo del año dos mil veintitrés (2023) (folio 67).</li><li>Auto de fecha 25 de abril del año 2023 (folio 68).</li><li>Constancia de notificación de fecha 25 de abril del año 2023 (folio 69).</li><li>Auto de fecha 25 de abril del año 2023 (folio 70).</li><li>auto de impulso de fecha 25 de abril del año 2023 (folio 71).</li><li>Certificación de acta de constitución dé la EMPRESA DE SERVICIOS MULTIPLES LAS MERCEDES DEL TABOR. (folio 72 al 94).</li><li>Escrito de subsanación de fecha 28 de abril del 2023 (folio 95).</li></ol><p><br></p><p><b>CUARTO:&nbsp;</b>Que la Ley del Sector Social de la Economía en su artículo 3 establece que el Sector Social de la Economía estará integrado por aquellas empresas constituidas exclusivamente por trabajadores que, de acuerdo con las leyes, se dediquen a la producción, industrialización, comercialización, prestación de servicios, y otras actividades, que sean de beneficio común de sus asociados y contribuyan al desarrollo económico y social del país.</p><p><b>QUINTO:&nbsp;</b>Que el Reglamento de la Ley del Sector Social de la Economía define al Organismo de Primer Grado como aquella unidad socioeconómica de base integrada principalmente por personas naturales y personas jurídicas, que se asocian para la prestación de servicios y otras actividades afines. Así mismo, el<b>&nbsp;ARTÍCULO 48 ESTABLECE:&nbsp;</b>son organizaciones o empresas de primer grado las unidades socioeconómicas integradas, principalmente, por personas naturales, pudiendo afiliarse personas jurídicas, sin fines de lucro, Bajo este concepto, son organizaciones o empresas de primer grado las siguientes: a) Cooperativas. b) Empresas Asociativas Campesinas. c) Tiendas comunitarias de abastecimiento y consumo. d) Tiendas populares de abastecimiento. e) Planes cooperativos sindicales. f) Cajas de ahorro y crédito, en sus diferentes modalidades. g) Asociaciones y productores. h) Cajas comunales. i) Empresas de servicios múltiples. j) Empresas de economía social que surjan al interior de las centrales de trabajadores, centrales campesinas, organizaciones gremiales y organizaciones para el desarrollo (OPDS). k) Otras que surjan de conformidad a lo establecido en los artículos 7 y 8 de la Ley.</p><p><b>SEXTO:&nbsp;</b>Que los requisitos exigidos para la constitución de empresas de primer grado conforme a la Oficina de Desarrollo del Sector Social de la Economía (ODS) son los siguientes:</p><ul><li>Carta Poder otorgada por el Presidente de la Organización o Empresa a favor del Apoderado(a) Legal.</li><li>Copia vigente de carnet de Apoderado Legal.</li><li>Informe de búsqueda de denominación de la Organización o Empresa emitida por la Oficina ODS.</li><li>Certificación de Acta de Constitución de la Organización o Empresa debidamente firmada por el Secretario(a), que incluya la lista de asociados participantes en la Asamblea General de Constitución, la cual deberá contener: Nombre, Número de Documento Nacional de Identificación (DNI), Firma o Huella, y Número de Teléfono Celular. La membresía para la constitución deberá ser con un mínimo de diez asociados.</li><li>Certificación de Acta de aprobación de Estatutos debidamente firmada por el Secretario(a).</li><li>Copia del Documento Nacional de Identificación (DNI) de los asociados, como Anexo.</li><li>Constancia del haber social emitida por una institución financiera (Banco o Cooperativa), o Balance General inicial firmado por un Perito Mercantil debidamente colegiado. De acuerdo al artículo 9 del reglamento de la Ley del SSE para todas las Organizaciones o Empresas de Primer Grado el haber social mínimo será de MIL LEMPIRAS EXACTOS (L. 1, 000.00) exceptuando las Cajas de Ahorro y crédito quienes deberán acreditar un haber social mínimo de CINCO MIL LEMPIRAS EXACTOS (L. 5,000.00).</li><li>Las firmas puestas en los literales a), c), d) y h) podrán ir en un solo Certificado de Autenticidad de conformidad a los artículos 40 y 41 del Reglamento del Código del Notariado.</li><li>Presentar Declaración Jurada donde se le dé cumplimiento a los Estatutos mismos que establecen que para ser miembro de la Junta Directiva no podrá ser conyugue o pariente entre sí con miembros del órgano de Fiscalización y con el Gerente dentro del cuarto grado de consanguinidad y segundo de afinidad. \"Firmada por el Presidente de la Junta Directiva\".</li></ul><p><b>Por lo anteriormente relacionado:&nbsp;</b>Después del análisis realizado al expediente de mérito, es procedente lo siguiente:</p><ol><li>Que la<b>&nbsp;“EMPRESA DE SERVICIOS MÚLTIPLES LAS MERCEDES EL TABOR”&nbsp;</b>, se establece como una organización del Sector Social de la Economía de<b>&nbsp;PRIMER GRADO&nbsp;</b>Y DE RESPONSABILIDAD LIMITADA, por estar constituida con&nbsp; Treinta y Tres (33) miembros debidamente inscritos, integrada con un Haber Social de L. 1000.00) exactos y cuya denominación social, es distinta a las demás empresas registradas en la Oficina de Desarrollo Social de la Economía.</li><li>Con base a todo lo anteriormente relacionado y analizado, el Análista Júridico en representación de la unidad de Formalización del sector social de la economía de SENPRENDE se pronuncia FAVORABLEMENTE en cuanto a lo solicitado, que se proceda a emitir resolución que en derecho corresponda para el otorgamiento de la<b>&nbsp;SE SOLICITA EL OTORGAMIENTO DE LA PERSONERIA JURIDICA, APROBACION DEL ACTA DE CONSTITUCION Y DE ESTATUTOS, INSCRIPCION EN EL REGISTRO DE EMPRESAS DEL SECTOR SOCIAL DE LA ECONOMIA; SE EMITA LA CONSTANCIA DE CUERPOS DIRECTIVOS, ASI COMO LA CONSTANCIA DE INSCRIPCION EN EL REGISTRO DE EMPRESAS DEL SECTOR SOCIAL DE LA ECONOMIA, APROBACION DEL ACTA DE CONSTITUCION Y DE ESTATUTOS Y CERTIFICACION DE LA PERSONERIA JURIDICA.- SE PRESENTAN DOCUMENTOS.- SE PRESENTA PODER.-&nbsp;</b>con domicilio en ALDEA MONTE VERDE , Municipio de SAN FRANCISCO DE OPALACA, Departamento de INTIBUCA. Su radio de acción será en todo el país.</li><li>Remítanse las presentes diligencias a la Sub Directora de Formalización a efecto de que proceda a emitir la correspondiente Resolución. Constando de Noventa y Siete (97) folios útiles.</li></ol><h3 style=\"text-align:center;text-transform:uppercase\">Fundamentos de derecho</h3><p>Artículos 78 80, 90,255 numeral 40) 321, 323 y 328 330,332 al 333 de la Constitución de la República; 1, 7, 41, 42, 116, 120 de la Ley General de la Administración Pública; 55, 56, 57, 60 inciso b), 61 y 62 de la Ley de Procedimiento Administrativo; Ley del Sector Social de la Economía y su Reglamento; 1, 3, 6,7,13,14,30,59,60,66,69, 72, 150 y 151 de la Ley de Procedimiento Administrativo; y en aplicación de los Artículos: del Decreto No. 193-85 y Acuerdos Ejecutivos números 254-97 y 187-2000; 1, 7, 8, 14 y 15 31,32 y 40 de la Ley del Sector Social de la Economía; 1 literales a), d), f), 4, 6, 7, 8,9, 13, 14, 15, 30, 31,41, 43, 47, 48 literal k) y 60 literales a) y b), 69 del Reglamento de la Ley del Sector Social de la Economía; y Decreto Ejecutivo No. PCM-006-2001 del 13 de agosto del 2001, y, 1, 2, 5 y 6 del Decreto Ejecutivo No. PCM-034-2019, Acuerdo de Delegación 14-2022; de la Ley de simplificación Administrativa 1,2 y demás que conforme a Derecho apliquen.</p><div style=\"text-align:center;margin-top:5rem\"><p><b>ABG. SERGIO ALFONSO HUETE BARAHONA</b></p>Analista de Formalizacion \\ SENPRENDE</div><div style=\"margin-top:5rem;text-align:center\"><img src=\"data:image/png;base64,\" style=\"width:128px;height:128px;margin:0 auto;display:block\"><small>*Escanea el documento para verificar su validez*</small></div></div></td></tr></tbody><tfoot><tr><td style=\"text-align:center;height:100px\">&nbsp;</td></tr></tfoot></table><footer style=\"text-align:center\"><p>Boulevard Juan Pablo II, Centro Cívico Gubernamental, Torre 2, Niveles Nº 12 y Nº 21, Tegucigalpa.</p><small>UPEG.R.01 | Revisión 08 | mayo del 2023</small></footer></main></body></html>'),(61,2,'{\"pageMargins\":[61,90,61,80],\"header\":{\"stack\":[{\"text\":\"Referencia: 1722634338135\",\"alignment\":\"right\",\"margin\":[4,4],\"font\":\"Arial\",\"fontSize\":10},{\"columns\":[{\"image\":\"public/images/logo_honduras_emprende_solidaria.jpg\",\"width\":118,\"height\":48,\"opacity\":0.55,\"alignment\":\"left\"},{\"width\":\"*\",\"text\":\"\"},{\"columns\":[{\"width\":\"*\",\"text\":\"\"},{\"image\":\"public/images/gob_logo.png\",\"width\":48,\"height\":43,\"marginRight\":2,\"opacity\":0.6},{\"image\":\"public/images/logo_senprende.jpg\",\"width\":87,\"height\":42,\"opacity\":0.55}],\"alignment\":\"right\"}],\"marginLeft\":61,\"marginRight\":61,\"marginTop\":31}]},\"content\":[{\"text\":\"SERVICIO NACIONAL DE EMPRENDIMIENTO Y DE PEQUEÑOS NEGOCIOS\",\"bold\":true,\"fontSize\":14,\"alignment\":\"center\",\"margin\":[0,30,0,26]},{\"text\":\"SENPRENDE \\nSUBDIRECCIÓN DE FORMALIZACIÓN\\nINFORME DE DENOMINACIÓN\",\"bold\":true,\"fontSize\":12,\"alignme